import React from 'react';
import Logo from '../../../utils/img/rsz_logo.jpg';
import { Menu, Container } from 'semantic-ui-react';

const TopNavbar = () => {
	return (
		<Menu size='large' attached style={{ border: 'none' }}>
			<Container>
				<Menu.Item as='button' active>
					Home
				</Menu.Item>
			</Container>
		</Menu>
	);
};

export default TopNavbar;
